import React from 'react';

function TimelineAnalyzer({ userGoal }) {
  return (
    <div className="p-8">
      <h2 className="text-3xl font-bold mb-4 text-center">Timeline Analyzer</h2>
      <div className="bg-white shadow-lg rounded-lg p-4">
        <label className="block mb-2">Your Goal:</label>
        <select className="w-full p-2 border border-gray-300 rounded-lg">
          <option value={userGoal}>{userGoal}</option>
        </select>
      </div>
    </div>
  );
}

export default TimelineAnalyzer;
